Condition : 4 - No development shall take place in any phase (pursuant to condition 3), including any works of demolition, until a Detailed Construction Logistics Plan has been submitted  for the requisite phase, and approved in writing by, the local planning authority in accordance with the format and guidance provided by the Transport for London - www.constructionlogisitcs.org. The Detailed Construction Logistics Plan shall provide for:

a) Parking of vehicles of site operatives/visitors;
b) HGV access to site - loading and unloading of plant and materials;
c) Number of HGV's anticipated;
d) Storage of plant and materials used in constructing the development; 
e) Programme of work and phasing (in line with the Phasing Strategy to be submitted pursuant to condition 3 attached to this permission); 
f) Site layout plan; 
g) Highway condition (before, during, after);
h) Measures to control dust and dirt during construction;
i) A scheme for recycling/disposing of waste resulting from demolition and construction works;
j) details showing the frontage/ the boundary of the site enclosed by site hording to a minimum height of 2 metres; and
k) Details of cranes and other tall construction equipment (including obstacle lighting).

The development shall be carried out in accordance with the approved Detailed Construction Logistics Plan(s), or any amendment or variation to it as may be agreed in writing by the local planning authority. 

REASON:  To minimise the impacts of construction upon the amenities of neighbouring occupiers and to ensure that development does not adversely affect safety on the transport network. Details are required PRIOR TO COMMENCEMENT OF DEVELOPMENT to ensure a satisfactory method of construction is agreed prior to any works on site commencing.

Condition : 8 - Notwithstanding the details shown on the approved drawings, the development relating to each building, plot or phase (whichever is relevant), hereby approved shall not progress beyond damp proof course level until samples of the materials (or appropriate specification) to be used in the construction of the external surfaces noted below have been submitted to, and agreed in writing by, the local planning authority:
a) facing materials for the building, including brickwork bond details;
b) windows/ doors, including those to all servicing areas; 
c) balcony screens including balustrade detail, privacy screens and soffits; 
d) boundary treatment including all vehicle and pedestrian/ access gates;
e) ground surfacing; and
f) raised planters. 
The development shall be carried out in accordance with the details so agreed and shall be retained as such thereafter.

REASON: To safeguard the appearance of the locality and to ensure a satisfactory form of development.

