Condition : 19 - The development hereby approved in relation to each plot or phase (whichever is relevant) shall not be first occupied until a parking management plan has been submitted to, and agreed in writing by, the local planning authority. The plan shall make provision for:

a)  details of how the parking spaces would be managed and allocated, including any enforcement procedure for any unauthorised parking on the site and assurance from the developer/owner that it shall fund the installation of the passive electric charging points as set out under sub-section b) below as and when required;

b) identify the electric vehicle charging point spaces that are to be provided within the podium car park as 'active' spaces' and those as 'passive' spaces', which shall include 20% fully active provision and remaining 80% to have passive provision;

c)  details of the relevant disabled person's parking spaces within the development (for residents);

d)  details of the provision of cycle parking for residents and visitors to the development, which shall include the type of cycle stands proposed (including specification);

e)  details and location of the spaces for parking motorbikes/scooters; and

f)  details of a servicing and delivery management plan. 

The development shall be carried out in accordance with the plan so agreed prior to the occupation of the relevant plot or phase, and shall be retained as such thereafter.

REASON: To ensure that the development provides sufficient disabled parking, cycle, motorcycle and electric vehicle charging points.
